KZ = g/uZ*((SZ^((sigZ-1)/sigZ)-(1-alpZ)^(1/sigZ)*LZ^((sigZ-1)/sigZ))/alpZ^(1/sigZ))^(sigZ/(sigZ-1));
DZ = (pZ*(Zd+Ze) - pL*LZ - pE*EZ - tPd*(pZ*(Zd+Ze) - pL*LZ - tSd*pL*LZ - QZ*delZ*KPZ/g) - tSd*pL*LZ - IPZ + BZ - RB/PiY*BZ/g);
EF = (1-alpE)*((pEF+tEFd)/pE)^(-sigE)*(EY+EZ);
pER = (((pE^(1-sigE)-(1-alpE)*(pEF+tEFd)^(1-sigE))/alpE)^(1/(1-sigE)));
ER = alpE*(pER/pE)^(-sigE)*(EY+EZ);
LR = WYE_bar*(pER*ER+pEF*EF)/pL/(1+1/LRLF_bar);
LF = LR/LRLF_bar;
LL = (1-alpL)*(pLL/pL)^(-sigL)*(LZ+LR+LF);
pLH = (((pL^(1-sigL)-(1-alpL)*pLL^(1-sigL))/alpL)^(1/(1-sigL)));
LH=LL*LHLL_bar; 
alpER = (1-((1+tSd)*pL/(pER*(ER/LR)^(1/sigER)))^sigER);
KR = g*((ER^((sigER-1)/sigER)-(1-alpER)^(1/sigER)*LR^((sigER-1)/sigER))/alpER^(1/sigER))^(sigER/(sigER-1));
DR = (pER*ER - pL*LR - tPd*(pER*ER - pL*LR - tSd*pL*LR - delR*KPR/g) - tSd*pL*LR - IPR + BR - RB/PiY*BR/g);
alpSF = (1-((tOd + RER*pO_RoW)/(pEF*(EF/O)^(1/sigSF)))^sigSF);
SF=((EF^((sigSF-1)/sigSF)-(1-alpSF)^(1/sigSF)*O^((sigSF-1)/sigSF))/alpSF^(1/sigSF))^(sigSF/(sigSF-1));
alpEF = (1-((1+tSd)*pL/(pEF*alpSF^(1/sigSF)*(EF/SF)^(1/sigSF)*(SF/LF)^(1/sigEF)))^sigEF);
KF = g*((SF^((sigEF-1)/sigEF)-(1-alpEF)^(1/sigEF)*LF^((sigEF-1)/sigEF))/alpEF^(1/sigEF))^(sigEF/(sigEF-1));
DF = (pEF*EF - pL*LF - RER*pO_RoW*O - tPd*(pEF*EF - pL*LF - tSd*pL*LF - tOd*O - RER*pO_RoW*O - delF*KPF/g) - tSd*pL*LF - tOd*O - IPF + BF - RB/PiY*BF/g);
NL = LL;
alpW_RoW=(1-Ze/Y_RoW/((pZ/RER)/pZ_RoW)^(-sigW_RoW));
tauZ1 = ((1-tPd)*pZ/(1+muP)*alpSZ^(1/sigSZ)*((Zd+Ze)/SZ)^(1/sigSZ)*alpZ^(1/sigZ)*(KZ/g)^((sigZ-1)/sigZ)*(SZ/uZ)^(1/sigZ))/((1-tPd)*KZ/g);
psiNH=(1-tHd)*pLH*LH/(LH^(1+etaH)/lamH*(1+muW));
psiNL = (1-tLd)*lamL*pLL/(ELi*NL)^etaL;
TLL = (CL + tCd*CL + tLd*pLL*LL - pLL*LL);
pSZ = DZ/(1/Lam/g-1);
pSR = DR/(1/Lam/g-1);
pSF = DF/(1/Lam/g-1);
vph = (1-tPd)*pZ/(1+muP);
A = (pLH*LH + RB/PiY*(BG+BP)/g + RW/PiY_RoW*RER*BW/g + RS/PiY*(pSZ+pSR+pSF)/g + (1-alpO)*RER*pO_RoW*O-(CH + tCd*CH + tHd*pLH*LH + tRd*((RB-1)/PiY*(BG+BP)/g + (RW-1)/PiY_RoW*RER*BW/g + (RS-1)/PiY*(pSZ+pSR+pSF)/g)))/(1+tAd);
TCH = tCd*CH;
TCL = tCd*CL;
TA = tAd*A;
TR = tRd*((RB-1)/PiY*(BG+BP)/g + (RW-1)/PiY_RoW*RER*BW/g + (RS-1)/PiY*(pSZ+pSR+pSF)/g);
TH = tHd*pLH*LH;
TL = tLd*pLL*LL;
TS = tSd*pL*LZ+tSd*pL*LR+tSd*pL*LF;
TSZ = tSd*pL*LZ;
TSR = tSd*pL*LR;
TSF = tSd*pL*LF;
TPZ = tPd*(pZ*(Zd+Ze) - pL*LZ - tSd*pL*LZ - QZ*delZ*KPZ/g);
TPR = tPd*(pER*ER - pL*LR - tSd*pL*LR - delR*KPR/g);
TPF = tPd*(pEF*EF - pL*LF - tSd*pL*LF - tOd*O - RER*pO_RoW*O - delF*KPF/g);
TEF = tEFd*EF;
TO = tOd*O;
T = (TCH + TCL + TA + TR + TH + TL + TSZ + TSR + TSF + TPZ + TPR + TPF + TEF + TO);

